    let buttonText="Hide explicit songs";

class Itunes extends Component {

  renderMusic() {
    let loop=[];

      for (let i=0;i<50;i++) {
          if(arr.results[i].kind === 'song') {
            if(this.state.explicit === true) {
                loop.push(<MusicItem key={i} name={arr.results[i].trackName} album={arr.results[i].collectionName} release={arr.results[i].releaseDate} link={arr.results[i].trackViewUrl} explicit={arr.results[i].trackExplicitness} />);
            }
           else {
             if (arr.results[i].trackExplicitness === 'cleaned') {
               loop.push(<MusicItem key={i} name={arr.results[i].trackName} album={arr.results[i].collectionName} release={arr.results[i].releaseDate} link={arr.results[i].trackViewUrl} explicit={arr.results[i].trackExplicitness} />);
              }
            }

        }
      }
    return loop;
  };

  constructor(props) {
    super(props);
    this.state = {
      explicit: true
    };
  }

  switchExplicit() {

    this.setState({
      explicit: !this.state.explicit
    })

    if (this.state.explicit === true) {
      buttonText="Show explicit songs";
    }
    else {
      buttonText="Hide explicit songs";
    }
  };

  render() {
    return (
      <div id="Itunes">
         <div id="reactsx">
            <button onClick={this.switchExplicit.bind(this)}>{buttonText}</button>
            <ul id="MusicList">
              {this.renderMusic()}
            </ul>
          </div>
      </div>
    );
  }
}

export default Itunes;
